      title:
        'DESIGUALDADE SOCIAL NO RIO GRANDE DO NORTE E A REALIDADE DAS MULHERES CATADORAS DE MATERIAIS RECICLÁVEIS: um debate sobre condições de gênero e desafios socio-organizativos na Rede Recicla Seridó',
      shift: 1,
      syllabus:
        'As Redes de Cooperação de Empreendimentos Econômicos Solidários de catadores e catadoras de materiais recicláveis são formadas pela união de cooperativas e associações com o objetivo de fortalecer produtiva e economicamente suas organizações na cadeia de valor da reciclagem. Formalmente, as redes se constituem como: uma cooperativa de segundo grau; uma central de cooperativas e associações; uma cooperativa singular ou associação de referência da rede.\nNesse contexto, a mesa redonda visa proporcionar o debate sobre a Rede Recicla Seridó existente no Rio Grande do Norte, enquanto articulação das associações e grupos de catadores e catadoras da região do Seridó/RN. Para isso parte de um debate inicial sobre análise de como se estruturam as desigualdades sociais no Brasil e Rio Grande do Norte e suas influências nas relações patriarcais de gênero no contexto das condições de vida, de trabalho e das iniciativas organizativas de mulheres catadoras de materiais recicláveis no Brasil, tendo como referência as que participam da Rede Recicla Seridó.\nÉ importante ressaltar que a Rede Recicla Seridó é uma rede de articulação e organização de catadoras e catadores que faz parte de um projeto coordenado pela Cáritas Diocesana de Caicó que visa auxiliar, por meio de algumas ações, na organização e fortalecimento das associações localizadas na Região do Seridó, situada no semiárido nordestino, porção centro-meridional do Estado do Rio Grande do Norte.\nA proposta parte de estudos no âmbito da pesquisa realizada para a construção da  dissertação de mestrado no Programa de Pós-Graduação em Serviço Social (PPGSS UFRN) intitulada  “Mulheres catadoras de materiais recicláveis: um debate sobre condições de gênero e desafios socio-organizativos na Rede Recicla Seridó”, e da formação acadêmica na Iniciação Científica das estudantes de pós graduação no âmbito do projeto de pesquisa “Políticas públicas nacionais de inclusão socioeconômica de catadores e catadoras de materiais recicláveis, no período 2007 a 2015”, bem como, agrega reflexões desenvolvidas no Grupo de Estudos e Pesquisas Questão Social, Política Social e Serviço Social sobre pobreza e desigualdade social no Brasil, Nordeste e Rio Grande do Norte.\nAssim, objetiva contribuir tanto para a discussão sobre as desigualdades sociais e econômicas brasileiras presentes na realidade nacional, regional e local quanto no que se refere às relações patriarcais de gênero no contexto das condições de vida, de trabalho e das iniciativas organizativas de mulheres catadoras de materiais recicláveis da Rede Recicla Seridó. Buscando constatar se essas mulheres, mesmo diante de inúmeras dificuldades, vivenciam processos em suas organizações coletivas que as despertam para a relevância social e ambiental do seu trabalho, para a potencialidade de se tornarem sujeitos políticos, bem como, se percebem a Rede Recicla Seridó como uma estratégia para superar a subordinação em que se encontram na cadeia produtiva da reciclagem.\nObjetivos\n\n•\tDiscutir as desigualdades sociais e econômicas brasileiras presentes tanto na realidade nacional quanto regionalmente no Nordeste Brasileiro e na particularidade do Estado do Rio Grande do Norte;\n\n•\tAnalisar as desigualdades sociais e relações patriarcais de gênero no contexto das condições de vida, de trabalho e das iniciativas organizativas de mulheres catadoras de materiais recicláveis da Rede Recicla Seridó;\n\n•\tApreender a realidade das mulheres catadores na Rede Recicla Seridó e seus desafios socio-organizativos;\n\n',
