      syllabus:
        'Proposta de Mesa-Redonda para participar do 25º Seminário de Pesquisa do CCSA. A proposta está relacionada com a  pesquisa Política Social e Reprodução da Força de Trabalho no Rio Grande do Norte, desenvolvida no âmbito dos grupos:  Grupo de Estudos e Pesquisas Trabalho, Ética e Direitos (GEPTED), e Grupo de Estudo e Pesquisa em Trabalho, Questão Urbano-rural-ambiental, Movimentos sociais e Serviço Social (QTEMOSS), o qual também são vinculados ao Programa de Pós-Graduação em Serviço Social (PPGSS) da UFRN. \nPara a construção da pesquisa e posteriormente da proposta para a mesa-redonda, foi utilizado o estudo sobre as categorias de análises dentro do Serviço Social, os livros, teses e dissertações, anais de eventos e periódicos. Os pressupostos metodológicos são os da mediação entre o Estado, a sociedade e o mercado, uma vez que tal mediação consiste em fio condutor da proposta na qual se vincula às pesquisas aqui reunidas. Os procedimentos metodológicos utilizados nos planos de trabalho para serem apresentados aqui são: revisão teórica e metodológica, e análise de dados a partir de categorias de busca. Foi utilizado o estudo teórico, também, pesquisas documentais e bibliográficas, tanto para identificar obras teóricas que apresentem contribuições ao debate em tela, como para produzir materiais explicativos e críticos sobre elas.',
