      _id: '64b59d5cea39bd00105b1bb8',
      title:
        'TIC’s e o Trabalho do/a Assistente Social na Pandemia: Uma discussão sobre a atuação profissional no IFRN e na UFRN',
      shift: 0,
      syllabus:
        'O surgimento da pandemia da covid-19 gerou inúmeras transformações em todos os âmbitos da sociedade, colocando para o mundo do trabalho alterações a partir do consumo e gestão da força de trabalho, sobretudo com o uso das Tecnologias de Informação e Comunicação (TIC´s). O espraiamento das TIC’s já se observa em período pré-pandêmico, mas  durante a crise sanitária emerge como uma alternativa de sobrevivência para os/as trabalhadores/as, em inúmeras áreas. O debate que envolve as TIC’s precisa considerar as controvérsias do seu uso e acesso, além das implicações para a realização da atividade laboral. Referente ao trabalho dos/as assistentes sociais na educação, especialmente no âmbito federal, a mediação das TIC’s se tornou o meio privilegiado de desenvolvimento do trabalho durante a pandemia em face do isolamento social. A crise sanitária agravou as expressões da questão social, colocando demandas novas e particulares para o trabalho profissional, como também para o público usuário dos serviços. Nesse sentido, a partir dos resultados das pesquisas e investigações, que resultaram nas dissertações de mestrado, serão apresentados os elementos centrais do trabalho dos/as assistentes sociais que atravessaram o período pandêmico no Instituto Federal de Educação, Ciência e Tecnologia e na Universidade Federal do Rio Grande do Norte. Ademais, à luz das realidades analisadas, apresentar-se-á a mediação da Assistência Estudantil diante do acirramento da questão social para os estudantes de origem popular nesse contexto. Por fim, espera-se, também, disseminar os conhecimentos gerados a partir de pesquisas do Programa de Pós Graduação em Serviço Social (PPGSS) da UFRN e colaborar para agregar elementos à discussão e análise sobre trabalho, serviço social e novas tecnologias frente às novas determinações do mundo do trabalho, bem como contribuir com  discentes de graduação, pós-graduação e profissionais do serviço social e de outras áreas impactados pela  crise pandêmica e pela utilização dos novos meios de comunicação na era digital.',
