        'Essa mesa-redonda é fruto dos estudos e pesquisas das/os discentes da pós-graduação em Serviço Social na linha de pesquisa Ética, Gênero, Cultura e Diversidade, bem como dos debates nos grupos de pesquisa GEPTED e QTEMOSS. O momento objetiva analisar como a agenda da diversidade sexual se torna um trampolim para a hegemonia conservadora na política brasileira; discutir sobre os limites postos pelo avanço do conservadorismo à saúde mental da população LGBTI+; apreender como as expressões do conservadorismo se expressam na LGBTIfobia infantojuvenil; e analisar as implicações da ideologia conservadora na vida de mulheres lésbicas e as contribuições da abordagem lésbica do feminismo materialista. A partir das normas do evento, o momento terá 2h de duração, tendo cada expositor de 15 a 20 minutos de fala (totalizando 1h20min de exposição dos temas), 30 minutos para o debate com o público e 10 minutos para as considerações finais.',
