        'Título da mesa-redonda: Pesquisando na era do ChatGPT: ferramentas e impactos\n\nTurno preferencial para realizar a Mesa Redonda: Dia 12/09 (terça) – Manhã\n\nLocal: NEPSA I\n\nObjetivos:\n1.\tExplorar o potencial das ferramentas baseadas em IA Generativa na pesquisa acadêmica e científica;\n2.\tDebater sobre os impactos positivos e negativos do uso de ferramentas como o ChatGPT na produção e disseminação de conhecimento;\n3.\tDiscutir a interação entre pesquisadores e ferramentas de IA Generativa, explorando como essa colaboração pode enriquecer a produção científica e estimular a criatividade;\n4.\tRefletir sobre as possíveis transformações no cenário da pesquisa acadêmica e científica com o avanço e a disseminação de ferramentas baseadas em IA Generativa;\n5.\tExplorar as questões éticas e de segurança relacionadas ao uso do ChatGPT na pesquisa, como plágio, uso fraudulento, viés algorítmico, privacidade e manipulação de dados.\n',
