      title: 'Diálogos sobre IA e o Trabalho do Amanhã: O Futuro em Debate ',
      shift: 0,
      syllabus:
        'Turno preferencial para realizar a Mesa Redonda: Dia 14/09 (quinta) pela manhã.\n\nObjetivos:\n1.\tAnalisar criticamente os impactos da inteligência artificial (IA) no mercado de trabalho, abordando aspectos como automação, substituição de empregos e transformação do trabalho;\n2.\tDiscutir as preocupações éticas e sociais relacionadas ao uso indevido da IA no ambiente de trabalho, incluindo a desinformação, manipulação de dados e a disseminação de informações falsas;\n3.\tAnalisar o aspecto da justiça e não-discriminação da IA, considerando a possibilidade da existência de preconceitos e desigualdades decorrentes da natureza dos dados coletados e dos modelos empregados;\n4.\tExplorar a natureza extrativa da tecnologia de IA e seus impactos nos trabalhadores, comunidades e recursos, além de discutir possíveis estratégias para mitigar esses efeitos negativos;\n5.\tEstimular a discussão sobre o papel das empresas, instituições educacionais e governos na adaptação às mudanças trazidas pela IA e na promoção de uma transição justa e inclusiva para o futuro do trabalho.',
